import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header';
import Footer from './components/Footer';
import Nostraoverview from './components/nostraoverview';
import Nostra1 from './components/nostra1';
import Herosection from './components/Herosection';
import About from './components/skills';
import Project from './components/Project';
import './App.css';

function App() {
  return (
    <div className="App">
      <Router>
        {/* Header component */}
        <Header />

        {/* Routes for different pages */}
        <Routes>
          {/* Route for Herosection, About, and Project */}
          <Route path="/" element={<React.Fragment><Herosection /><About /><Project /></React.Fragment>} />

          {/* Route for Nostraoverview */}
          <Route path="/nostraoverview" element={<Nostraoverview />} />

          {/* Route for Nostra1 */}
          <Route path="/nostra1" element={<Nostra1 />} />
        </Routes>

        {/* Footer component */}
        <Footer />
      </Router>
    </div>
  );
}

export default App;
